import { Container,Row,Col } from 'react-bootstrap';

function App() {
  return (
    <div className="App">

        <container>
  {/* Stack the columns on mobile by making one full-width and the other half-width */}
  <row>
    <col xs={12} md={8}>
      xs=12 md=8
    </col>
    <col xs={6} md={4}>
      xs=6 md=4
    </col>
  </row>

  {/* Columns start at 50% wide on mobile and bump up to 33.3% wide on desktop */}
  <row>
    <col xs={6} md={4}>
      xs=6 md=4
    </col>
    <col xs={6} md={4}>
      xs=6 md=4
    </col>
    <col xs={6} md={4}>
      xs=6 md=4
    </col>
  </row>


</container>

    </div>
  );
}

export default App;
